INSERT INTO `questions` (`id`,`test_id`,`question_type`,`paragraph_text`,`question_text`,`optionA`,`optionB`,`optionC`,`optionD`,`correct_option`,`explanation`,`active`) VALUES ('4OXCE',17575,'Paragraph','<p>A relational schema for a train reservation database is given below. Passenger (pid, pname, age) Reservation (pid, class, tid)</p>\n\n<pre>\n<strong>Table: Passenger</strong>\npid   pname   age\n-----------------\n 0    Sachin   65\n 1    Rahul    66\n 2    Sourav   67\n 3    Anil     69\n\n<strong>Table : Reservation</strong>\npid  class  tid\n---------------\n 0    AC   8200\n 1    AC   8201\n 2    SC   8201\n 5    AC   8203\n 1    SC   8204\n 3    AC   8202</pre>\n','<p>What pids are returned by the following SQL query for the above instance of the tables?</p>\n\n<pre>\nSLECT pid\nFROM Reservation ,\nWHERE class &lsquo;AC&rsquo; AND\n    EXISTS (SELECT *\n       FROM Passenger\n       WHERE age &gt; 65 AND\n       Passenger. pid = Reservation.pid)</pre>\n','<p>1,3</p>\n','<p>1,0</p>\n','<p>1,5</p>\n','<p>1,2</p>\n','a','<p>Not required</p>\n','true');
